import TshirtData from "./TshirtData";

const Tshirt = (props) => {
    return (
        <div>
            {props.list.map(item => (
                <li key={item.id}>
                    <TshirtData
                        name={item.name}
                        description={item.description}
                        price={item.price}
                    />
                </li>
            ))}
        </div>
    );
};

export default Tshirt;
